import React from "react";
import PropTypes from "prop-types";

const Posts = ({ posts, onRemove }) => {
  function removeElement(id) {
    onRemove(id);
  }
  return (
    <div>
      <h1></h1>
    </div>
  );
};

Posts.propTypes = {};

export default Posts;
